import React from 'react';
import './ProfileCard.css';
import profilePic from './profile-pic.jpg'; // replace with actual profile image path

function ProfileCard() {
    function ProfilePhoto() {
        return (
            <div className="profile-photo-container">
                <img src={profilePic} alt="Ethan Feiges" className="profile-photo" />
                <div className="profile-info">
                    <h1>Ethan Feiges</h1>
                    <p>College: UW-Madison</p>
                    <p>Major: CS</p>
                    <p>Year: Sophomore</p>
                    <p>Age: 19</p>
                </div>
            </div>
        );
    }
}


export default ProfilePhoto;
